import {ReactComponent as GithubIcon} from 'assets/img/github.svg'

function Navbar() {
    return (
      <header>
        <nav>
          <h1>DSMovie</h1>
          <a href="https://github.com/alexandre-medeiros"></a>
          <div>
            <GithubIcon/>
          </div>
        </nav>
      </header>
  
      );
  }
  
  export default Navbar;
